import React, { useEffect,useState } from "react";
import {EditNurse} from "./EditNurse";
export function  NurseTable()
{

    const [nurses, setNurses] = useState([]);
    const [nurseEdit, setNurseEdit] = useState(false);
    const [nurse, setNurse] = useState(false);

    var myHeaders = new Headers();
    myHeaders.append("Access-Control-Allow-Origin", "*");

    var requestOptions = {
      method: 'GET',
      headers: myHeaders,
      mode: 'cors',
      redirect: 'follow'
    };

useEffect(() => {
    fetch("http://localhost:3000/nurse", requestOptions)
      .then(response => response.json())
      .then(result => {setNurses(result) ;console.log(result[0]["password"])
    })
      .catch(error => console.log('error', error));
    }, []);

    return(
        <div> 
        {!nurseEdit && 
<div class="relative overflow-x-auto shadow-md sm:rounded-lg">
    <table class="w-full text-sm text-left rtl:text-right text-gray-500 dark:text-gray-400">
        <thead class="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
            <tr>
                <th scope="col" class="px-6 py-3">
                    Name
                </th>
                <th scope="col" class="px-6 py-3">
                    Employee ID
                </th>
                <th scope="col" class="px-6 py-3">
                    User Id
                </th>
                <th scope="col" class="px-6 py-3">
                    Age
                </th>
                <th scope="col" class="px-6 py-3">
                    Gender
                </th>
                <th scope="col" class="px-6 py-3">
                    Address
                </th>
                <th scope="col" class="px-6 py-3">
                    Ph Number
                </th>
            </tr>
        </thead>
        <tbody>
        {nurses.map((nurse) => 
            <tr class="bg-white border-b dark:bg-gray-800 dark:border-gray-700">
                <th scope="row" class="px-6 py-4 font-medium text-gray-900 whitespace-nowrap dark:text-white">
                    {nurse["f_name"]} {nurse["mi"]} {nurse["l_name"]}
                </th>
                <td class="px-6 py-4">
                    {nurse["employee_id"]}
                </td>
                <td class="px-6 py-4">
                    {nurse["user_id"]}
                </td>
                <td class="px-6 py-4">
                    {nurse["age"]}
                </td>
                <td class="px-6 py-4">
                    {nurse["gender"]}
                </td>
                <td class="px-6 py-4">
                    {nurse["address"]}
                </td>
                <td class="px-6 py-4">
                    {nurse["phone_no"]}
                </td>

                <td class="px-6 py-4">
                    <button onClick={()=>{setNurseEdit(true)}} class="font-medium text-blue-600 dark:text-blue-500 hover:underline">Edit</button>
                </td>
            </tr>
            )}

        </tbody>
    </table>
</div>

        }
   {nurseEdit && 
   <div> 
   <button  class=" m-2 bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
            type="button"
            data-ripple-light="true" onClick={()=>{setNurseEdit(false)}} >Back</button>
        <EditNurse nurse={nurse}/>
        </div>
   }
        </div>
  )
}
